import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';  // Import the Navbar
import BookListPage from './BookListPage';  // Your Book List component
import MyIssuedBooksPage from './MyIssuedBooksPage';  // Your My Issued Books component
import LoginPage from './LoginPage';  // Your Login component
import SignUpPage from './SignUpPage';  // Your SignUp component

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path="/booklist" component={BookListPage} />
        <Route path="/myissuedbooks" component={MyIssuedBooksPage} />
        <Route path="/login" component={LoginPage} />
        <Route path="/signup" component={SignUpPage} />
        <Route path="/" exact>
          <h1>Welcome to the Library</h1>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
